import React from "react";
import "./style.css";

const Header = props => {
  <header className="header">
    <h1>Clicky Game!</h1>
    <h2>
      Click on an image to earn points, but don't click on any image more than
      once!
    </h2>
    {props.children}
  </header>;
};

export default Header;
